9. Criterios para Pontuacao.
9.1 A pontuacao a ser obtida pelos candidatos ao auxilio financeiro sera de no maximo 100 pontos, 
os quais serao alcancados a partir da analise dos criterios estabelecidos;
9.2 As areas de conhecimento designadas como PRIORItARIAS, englobam os cursos de im-
pacto direto e secundario na consecucao das politicas governamentais sob a responsabilidade da 
Sociedade de Abastecimento de Brasilia S/A, Em liquidacao/unidade em extincao, aos quais e 
atribuida a pontuacao definida no quadro abaixo tendo como referencia a tabela do Ministerio 
da Educacao: 
CuRSOS - PONtuACAO
Administracao de Empresas, Ciencias Contabeis, Direito  - 35;
Arquitetura, Ciencias, Economicas, Cursos na Area de Sistema da Informacao, Cursos de tec-
nologos/Gestao Publica/RH/Ambientais  30;
Comunicacao Social, Letras, Psicologia, Pedagogia, Servico Social, Demais cursos  25;
Demais Cursos/2a Graduacao  15;
Cursos de Linguas Estrangeiras  10.
10. Prazo de Conclusao do Curso
10.1 Considerar-se-a para auxilio financeiro a quantidade de semestres restantes para a conclusao 
do curso, segundo o estipulado pela Instituicao de Ensino;
10.2 Os cursos, cujos periodos consideram o semestre letivo, sao transformados, para efeito de 
criterios neste Anexo, em anos calendario;
10.3 O criterio de prazo para a conclusao do curso obedece a escala de pontuacao definida no 
quadro abaixo: 
ESCALA DE PONtuACAO
Conclui no ano de concessao  - 35 pontos;
No ano seguinte - 30 pontos;
Apos 03 anos da concessao - 25 pontos;
Apos 04/05 anos da concessao - 15 pontos;
Apos 06 anos ou mais da concessao - 10 pontos.
11. Numero de Dependentes. 
11.1 A definicao do criterio considera que os empregados com maiores encargos financeiros, 
decorrente do numero de filhos/enteados dependentes, possuem maior dificuldade para conclusao 
do curso superior;
11.2 O criterio de numero de dependentes levara em consideracao os dados constantes do SIGRH, 
conforme escala a seguir:
ESCALA DE PONtuACAO
Acima de 03 dependentes legais - 30 pontos;
03 dependentes legais - 25 pontos;
02 dependentes legais - 20 pontos;
01 dependente legal - 15 pontos.
12. Sistematica de Selecao.
12.1 A Classificacao dos candidatos sera feita com base na seguinte formula:
PC = (AC + CC + ND) onde:
PC = Pontos de Classificacao;
AC = Pontos de Area de Conhecimento;
CC = Pontos do Prazo para Conclusao de Curso; e
ND = Pontos de Numero de Dependentes. 
12.2 Serao selecionados os empregados com maior pontuacao de acordo com a formula constante 
no subitem 12.1;
12.3 Ocorrendo o empate nos Pontos de Classificacao  PC, o desempate obedecera a ordem 
de criterios a seguir:
a) menor remuneracao total (renda per capita da familia);
b) maior tempo no Orgao; e
c) persistindo o empate, sera selecionado o empregado de maior idade.
13. Das competencias
13.1 O Departamento de Recursos Humanos - DERHu compete:
I - Propor valores e quantidades de bolsas anuais;
II - Selecionar beneficiarios, dentre os inscritos;
III - Divulgar os resultados do processo seletivo, detalhando as pontuacoes individuais na Intranet 
e/ou Boletim de Servico; e
IV - Controlar e efetuar o pagamento do auxilio financeiro, assim como zelar pela manutencao 
dos registros documentais e eletronicos.
14. Disposicoes Gerais
14.1 Sera automaticamente eliminado da lista de selecionados o empregado que nao apresentar 
a documentacao necessaria no prazo estabelecido pelo Departamento de Recursos Humanos, 
sendo automaticamente substituido pelo proximo empregado na lista de classificacao, sendo-lhe 
avisado da substituicao;
14.2 A Sociedade de Abastecimento de Brasilia S/A, Em liquidacao/unidade em extincao 
custeara exclusivamente os cursos superiores em nivel de graduacao relacionados na tabela do 
Ministerio da Educacao, ou no caso de cursos sequenciais, quando ministrados por instituicao 
reconhecida por aquele Ministerio.

